import { IoCloseCircleSharp, IoHammerSharp } from 'react-icons/io5'

const User = (props) => {
  return (
    <div className="user" >
      <IoCloseCircleSharp className='delete-icon' onClick={() => props.removeUser(props.user)} />
      <IoHammerSharp className='edit-icon' />
        <h3>{props.user.first_name}</h3>
        <p>{props.user.last_name}</p>
        <p>{props.user.age}</p>
    </div>
  )
} 

export default User
